import React from 'react';

const Home = () => {
  return (
    <div className="container mx-auto p-4">
      <h1 className="text-4xl font-bold text-blue-600 mb-4">Welcome to Our Insurance Services</h1>
      <p className="text-lg text-gray-700">
        We provide the best health insurance plans tailored to your needs.
      </p>
    </div>
  );
};

export default Home;
